window.onload = function(){

    'use strict';

    var
        // satisfy jslint
        sequencer = window.sequencer,
        console = window.console,
        btnLoad = document.getElementById('load'),
        btnPlay = document.getElementById('play'),
        btnStop = document.getElementById('stop'),
        instrument;


    sequencer.addSamplePack({
        name: 'piano',
        folder: 'instruments',
        mapping:
        {
            60:"",
            61:"",
            62:"",
            63:""

        }
    }, createInstrument);



    btnLoad.addEventListener('click', function(){
        sequencer.addSamplePack({
            name: 'piano',
            folder: 'instruments',
            action: 'append',
            mapping: {
                64:"",
                65:"",
                66:"",
                67:""
            }
        }, function(){
            instrument.parse();
        });
    });


    function createInstrument(){
        sequencer.addInstrument({
            name: 'piano',
            sample_path: 'instruments/piano',
            mapping: [60, 67]
        },function(){
            createSong();
        });
    }


    function createSong(){
        var song, track, part, ticks = 0, noteNumber = 60;

        part = sequencer.createPart();
        while(noteNumber < 68){
            part.addEvents(sequencer.createMidiEvent(ticks, 144, noteNumber, 100));
            ticks += 480;
            part.addEvents(sequencer.createMidiEvent(ticks, 128, noteNumber, 0));
            noteNumber++;
        }

        track = sequencer.createTrack();
        track.addPart(part);
        track.setInstrument('piano');
        instrument = track.instrument;

        song = sequencer.createSong({
            useMetronome: true,
            tracks: track,
            loop: true
        });

        song.setLeftLocator('ticks', 0);
        song.setRightLocator('ticks', ticks + 480 + 480);

        btnPlay.addEventListener('click', function(){
            song.play();
        });

        btnStop.addEventListener('click', function(){
            song.stop();
        });
    }

};